// env
function Env(name) {
  return new (function () {
    const isQX = () => typeof $task !== 'undefined';
    const isSurge = () => typeof $httpClient !== 'undefined' && typeof $loon === 'undefined';
    const isLoon = () => typeof $loon !== 'undefined';
    this.name = name;
    this.log = function () { console.log([...arguments].join('\n')); };
    this.msg = function (t, s, b) { if (isSurge() || isLoon()) $notification.post(t, s, b); if (isQX()) $notify(t, s, b); };
    const sender = (opts, cb) => {
      const m = (opts.method || 'GET').toLowerCase();
      if (isSurge() || isLoon()) $httpClient[m](opts, (e, r, d) => { if (r && r.status) r.statusCode = r.status; cb(e, r, d); });
      else if (isQX()) $task.fetch(opts).then(r => cb(null, { statusCode: r.statusCode, headers: r.headers }, r.body), e => cb(e));
    };
    this.get = (o, c) => { o.method = 'GET'; sender(o, c); };
    this.post = (o, c) => { o.method = 'POST'; sender(o, c); };
  })();
}
